  02> JOBSON, Nicola Margaret
  b 13.08.1973
  Nicola b. at Gisborne. She was educated at Woodford House and Gisborne Girls' High School then
  graduated BA in Social Policy from Victoria University. She works for Internal Affairs in
  Wellington.
  03> JOBSON, Timothy Dixon
  b 01.12.1977
  Timothy b. at Gisborne. He was educated at Gisborne Boys' High School and is now studying Law
  and Commerce at Otago University.
  02> JEFFERD, Roger John m on 03.12.1971 to VICKERS, Kathryn
  b 12.05.1948
  b 09.08.1951
  01> JEFFERD, Anthony Roger
  b 12.06.1973
  Anthony b. at Te Puia. He was educated at Tokomaru Primary School, Huntley School in Marton
  and Wanganui Collegiate School. He worked for two years as a shepherd on "Tunanui" station in
  Hawkes Bay followed by two years overseas. He is now managing a property in Gisborne.
  02> JEFFERD, Georgina Kathryn
  b 09.10.1975
  Georgina b. at Te Puia. She was educated at Tokomaru Bay Primary School, Gisborne Intermediate
  and Nga Tawa School then graduated DipTchng and Bed from Victoria University. She is now
  teaching in Gisborne.
  03> JEFFERD, Caroline Rose
  b 04.12.1978
  Caroline b. at Te Puia. She was educated at Tokomaru Bay Primary School, Gisborne Intermediate
  and Nga Tawa School, Marton. She is now studying towards a Bachelor of Applied Science degree
  in Agricultural Business at Massey University.
  03> JEFFERD, Marianne Caroline m on 22.11.1980 to MACKIE, Neil Matthew
  Busby
  b 28.07.1954
  b 14.05.1953
  Marianne b, at Tokomaru Bay. Neil, s/o Richard Falconer Mackie and Gwen Mary Fryer. Address: 12
  Graham Road, Gisborne.
  Marianne was educated at Tokomaru Primary School, Queenswood School and Woodford House. She owned
  and operated Catalogues Boutique, a women's retail clothing business in Gisborne between 1983 and
  1996. She is a now Marketing Executive and Projects Manager.
  01> MACKIE, Melanie Caroline
  b 03.06.1982
  Melanie b. at Gisborne. She was a student at Te Wharau Primary School, Ilminster Intermediate
  and Woodford House and is attending King's College for her sixth form year.
